import React from "react";
import CurrencyTable from "./CurrencyTable";

const CurrencyTableContainer = (props) => {
  return (
    <div>
      <CurrencyTable
        data={props.data}
        availableCurrency={props.availableCurrency}
      />
    </div>
  );
};

export default CurrencyTableContainer;
